  false,\n\t\"url\": null,\n\t\"notes\": \"This collection consists of images of 1,235
  ship logbooks created during British East India Company voyages. Period of record
  1786-1834, peaking in 1804. The logbooks were held and scanned at the British Library
  in London. Most observations taken on voyages between Southern English ports and
  the east coast of India, Indonesia and southeast China. Pressure, wind and air temperature,
  along with sea temperature late in the period. Data from the images has also been
  keyed by the Climate Database Modernization Program and added to the ICOADS dataset.
  See associated documentation for more information on the availability of keyed data.\",\n\t\"license_title\":
